create user profile identified by 1234;
grant connect,resource,dba to profile;
grant create session, connect, resource to profile;


create sequence HIS_AND_PAID_ORDER_ID   
    increment by 1  
    start with 100  
    maxvalue 9999999999;  
select HIS_AND_PAID_ORDER_ID.nextval from dual;


create sequence SEQ_USER_ID  
    increment by 1  
    start with 2000  
    maxvalue 9999999999; 

create sequence SEQ_LOST_KEY   
    increment by 1  
    start with 2100  
    maxvalue 9999999999; 

create sequence SEQ_RESOURCE_ID  
    increment by 1 
    start with 2100  
    maxvalue 9999999999; 
select SEQ_RESOURCE_ID.nextval from dual;


create table DEMO_USER
(
    USER_ID        NUMBER(9)     not null
        constraint PK_DEMO_USER
            primary key,
    USER_NAME      VARCHAR2(120) not null,
    STATE          CHAR          not null,
    CREATE_DATE    DATE          not null,
    STATE_DATE     DATE          not null,
    EMAIL          VARCHAR2(120) not null
        constraint EMAIL
            unique,
    LOST_FOUND_KEY NUMBER(9)     not null,
    PHONE_NUMBER   NUMBER(11)    not null
        constraint PHONE_NUMBER
            unique,
    PASS_WORD      VARCHAR2(20)  not null
)
/

